contracts/gg.sol.content:
//SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;
contract hhh{
    enum roomsize{
        small,
        medium,
        large
    }
    struct room {
        roomsize RS;
        uint roomno;
    }
    mapping (roomsize=>room) map;
    function ff()public{
        map[roomsize.small] = room(roomsize.small,10);
        // map[roomsize(0)] = room(roomsize(3),25);
        // map[2] = room(roomsize(1),40);
    }
    function fcalldata(uint[] calldata _x)public pure returns(uint[] calldata){
        return _x;
    }
    struct person{
        string name;
        uint age;

    }
     enum status{
        Enrolled,
        NotEnrolled,
        Graduated,
        Expelled

    }
    status[3] cl; 
    function updatePersonAge(person memory _person,uint _age) public pure returns(person memory){
        _person.age = _age;
        return _person;
    }
 }

